import styled from 'styled-components'

const AboutContainer = styled.div`
  min-height: calc(100vh - 60px);
  margin: 0 auto;
  max-width: 1100px;
  padding: 10px;
`

const ProfilePicture = styled.img`
  margin: 0 auto;
  height: 80%;
  width: 80;
`

const About = () => {
  return (
    <AboutContainer></AboutContainer>
  )
}

export default About
